import React from 'react'
import './Exp.css'


function Exp(props) {
  return (
    <div className='conatinerin12'>
        <img src={props.Api.img} className='image' alt="" />
        <h3 className='text'>{props.Api.text}</h3>
    </div>
  )
}

export default Exp
